// Hdr.js
import React from 'react';
import Button from './Button'; // Assuming you have a Button component
import './Hdr.css';

const Hdr = ({ onAddUserClick }) => {
  const signInButtonStyle = {
    position: 'absolute',
    top: 0,
    right: 0,
    padding: '20px', // Adjust the padding as needed
  };

  return (
    <div className="hdr">
      <h1>cinema review</h1>
      <div className="button-container">
        <Button onClick={onAddUserClick}>Write a review!</Button>
        <Button onClick={onAddUserClick} style={signInButtonStyle}>
          Sign In
        </Button>
      </div>

      {/* Placeholder for absolute images */}
      <div className="absolute-images">
        {/* Place your images here with absolute positioning */}
        <img src="https://cdn.discordapp.com/attachments/341337244927524873/1176216473161715786/image.png?ex=656e0ff4&is=655b9af4&hm=d30a4a61fa2720041d05576edb20419e13151abe3ca8d9c85d0c8a4e16386dba&" alt="Image 1" style={{ position: 'absolute', top: '20px', left: '20px' }} />
        <img src="https://example.com/image2.jpg" alt="Image 2" style={{ position: 'absolute', top: '60px', left: '50px' }} />
      </div>
    </div>
  );
};

export default Hdr;
